import axios from "axios";
import { useCallback, useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";

function Table() {
  const [data, setData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(10);

  const fetchData = useCallback(async () => {
    try {
      const response = await axios.get("/api/tickets");
      setData(response.data);
    } catch (error) {
      console.error(error);
    }
  }, []);

  useEffect(() => {
    fetchData();
  }, [fetchData]);

  const headers = {
    Lvl: "priorityIdById",
    "#": "id",
    Title: "title",
    Module: "ApplicationName",
    Type: "TicketTypeById",
    State: "statusById",
  };

  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentItems = data.slice(indexOfFirstItem, indexOfLastItem);

  // Change page
  const paginate = (pageNumber: number) => setCurrentPage(pageNumber);

  const navigate = useNavigate();

  const handleViewClick = (rowId: number) => {
    navigate(`/tickets/${rowId}`);
  };

  return (
    <div className="flex flex-col container">
      <Link to="/tickets/newTicket">
        <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
          Create new ticket
        </button>
      </Link>
      <div className="overflow-x-auto sm:-mx-6 lg:-mx-8">
        <div className="inline-block min-w-full py-2 sm:px-6 lg:px-8">
          <div className="overflow-hidden">
            <table className="min-w-full border text-center text-sm font-light dark:border-neutral-500">
              <thead className="border-b font-medium dark:border-neutral-500">
                <tr>
                  {Object.keys(headers).map((header, index) => (
                    <th
                      key={index}
                      scope="col"
                      className={`border-r px-6 py-4 dark:border-neutral-500 ${
                        index === Object.keys(headers).length - 1
                          ? ""
                          : "border-r"
                      }`}
                    >
                      {header}
                    </th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {currentItems.map((item, index) => (
                  <tr
                    key={index}
                    className="border-b dark:border-neutral-500"
                    onClick={() => handleViewClick(item.id)}
                  >
                    <td
                      className={`whitespace-nowrap ${
                        index === Object.keys(item).length - 1 ? "" : "border-r"
                      } px-6 py-4 ${
                        index === 0 ? "font-medium dark:border-neutral-500" : ""
                      }`}
                    >
                      {item.priorityIdById.title}
                    </td>
                    <td
                      className={`whitespace-nowrap ${
                        index === Object.keys(item).length - 1 ? "" : "border-r"
                      } px-6 py-4 ${
                        index === 0 ? "font-medium dark:border-neutral-500" : ""
                      }`}
                    >
                      {item.id}
                    </td>
                    <td
                      className={`whitespace-nowrap ${
                        index === Object.keys(item).length - 1 ? "" : "border-r"
                      } px-6 py-4 ${
                        index === 0 ? "font-medium dark:border-neutral-500" : ""
                      }`}
                    >
                      {item.title}
                    </td>
                    <td
                      className={`whitespace-nowrap ${
                        index === Object.keys(item).length - 1 ? "" : "border-r"
                      } px-6 py-4 ${
                        index === 0 ? "font-medium dark:border-neutral-500" : ""
                      }`}
                    >
                      {item.applicationName}
                    </td>
                    <td
                      className={`whitespace-nowrap ${
                        index === Object.keys(item).length - 1 ? "" : "border-r"
                      } px-6 py-4 ${
                        index === 0 ? "font-medium dark:border-neutral-500" : ""
                      }`}
                    >
                      {item.ticketTypeById.title}
                    </td>
                    <td
                      className={`whitespace-nowrap ${
                        index === Object.keys(item).length - 1 ? "" : "border-r"
                      } px-6 py-4 ${
                        index === 0 ? "font-medium dark:border-neutral-500" : ""
                      }`}
                    >
                      {item.statusById.title}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
      {/* Pagination */}
      <div className="flex justify-center mt-4">
        <ul className="flex items-center">
          {Array.from({ length: Math.ceil(data.length / itemsPerPage) }).map(
            (_, index) => (
              <li key={index}>
                <button
                  onClick={() => paginate(index + 1)}
                  className={`px-3 py-1 rounded-md focus:outline-none ${
                    currentPage === index + 1
                      ? "bg-blue-500 text-white"
                      : "bg-gray-200 text-gray-700"
                  }`}
                >
                  {index + 1}
                </button>
              </li>
            )
          )}
        </ul>
      </div>
    </div>
  );
}

export default Table;
